import React from 'react';
const AppBarComponent = ()=>
{
    return (
        <div className = {classes.mainContainer}>
            <AppBar>
                <Toolbar>
                    <Typography>Journalism By Arun</Typography>
                    <Tabs>
                        <Tab label = 'Home' />
                    </Tabs>
                </Toolbar>
            </AppBar>
            <div className = {classes.appBarSpacer}>
            </div>
        </div>
    );       
}
export default AppBarComponent;
